    var itemmap = new Item_Map()

    async function updateTable(){
      updateButtonTextUpdating()
      itemmap.clearMap()
      updateItemMap(itemmap,materials).then(x => updateItemMap(itemmap, artefact1)).then(x => updateItemMap(itemmap, artefact2)).then(x => updateItemMap(itemmap, armor1)).then(x => updateItemMap(itemmap, armor2))
      .then(x => updateItemMap(itemmap, staff1)).then(x => updateItemMap(itemmap, staff2)).then(x => updateItemMap(itemmap, tomestaff3))
      .then(x => updateTableValues()).then(x => updateButtonTextUpdated())
    }

    async function updateTableValues(){
      createTableFromRecipes(recipes[$("#category").val()], itemmap)
      updateProfit()
      changeProfitColor()
      showOnlyEnchant($("#enchantLevel").val())
      bindSelectRow()
    }

    $(document).ready(function(){
      createNavBar()
      updateTable()
      $("#category").change(function() { updateTableValues() })
      $("#quality").change(function() { updateTableValues() })
      $("#enchantLevel").change(function() { updateTableValues() })
      $("#locations").change(function() { updateTableValues() })
    })